import React from "react";
import TopNav from '../components/Navbar/TopNav';
//import { useNavigate } from 'react-router-dom';
const Main = () => {
return (
	<div className='full_div'>
		<TopNav />
		<div style={{ display: 'flex', justifyContent: 'flex-end' }}>
			<input 
  			type="text" 
  			placeholder="Search products..."
  			style={{
  			  backgroundColor: '#ccc',
  			  borderRadius: '20px',
  			  padding: '10px',
  			  border: 'none',
  			  width: '200px',
			  height: '50px',
  			  textAlign: 'left',
  			  marginBottom: '10px'	,
			  marginTop:'10px',
			  marginRight: '30px'
  			}}
		/>
		</div>
		<div style={{display: 'flex'}}>
			<div style={{width: '20%', border: '5px solid #6B8E23' }}>
			    <h2 className="plants-to-show">Categories:</h2>
			    <div id="all-plants" onClick={() => {
			      const indoorPlants = document.getElementById("indoor-plants");
			      const outdoorPlants = document.getElementById("outdoor-plants");
			      indoorPlants.style.display = "block";
			      outdoorPlants.style.display = "block";
			    }}>All Plants</div>
			    <div id="indoor-plants" style={{display: "none"}}>
			      <p>Indoor Plants:</p>
			      <ul>
			        <li>Plant 1</li>
			        <li>Plant 2</li>
			        <li>Plant 3</li>
			      </ul>
			    </div>
			    <div id="outdoor-plants" style={{display: "none"}}>
			      <p>Outdoor Plants:</p>
			      <ul>
			        <li>Plant 4</li>
			        <li>Plant 5</li>
			        <li>Plant 6</li>
			      </ul>
			    </div>
			  </div>
			<div style={{flex: 1,border: '5px solid #6B8E23'}}>
				<h2 className="plants-to-show">Plants to show:</h2>
			</div>
		</div>

    </div>
);
};

export default Main;
